import { Link } from 'react-router-dom';
import Post from "../../components/post/Post"
import axios from "axios"
import { useContext, useEffect, useState } from "react"
import { AuthContext } from "../../context/AuthContext"
import DeleteApp from "../../components/deleteApp/DeleteApp";

export default function Rea() {
  const [posts, setPosts] = useState([]);
  const {user} = useContext(AuthContext)

  useEffect(()=>{
    const fetchPosts = async () => {
    const res = await axios.get("/api/apps/timeline/" + user._id);
    setPosts(res.data);
    };
    fetchPosts();
  }, []);

  return (
    <div>
    <div className="rea">
      <Link className="realink" to='/home' > Go to Homepage</Link>
      <div className="reaname">Create App's</div>
      <div className="reaname">Delete App's</div>
      <div className="reaname2">All Application's</div>
      {posts.map((p)=> (
        <Post key={p.id} post={p} />
      ))}
      </div>
    </div>
  )
}
